import React from "react";

const Projects = props => {
  return (
    <div>
      {props.languages.map(item => {
        let years = 2;
        let nbreExp =
          (item.xp / years) * 100 +
          "%"(
            <div className="progress">
              <div
                className="progress-bar "
                role="progressbar"
                style={{ width: { nbreExp } }}
                aria-valuenow="25"
                aria-valuemin="0"
                aria-valuemax="100"
              >
                25%
              </div>
            </div>
          );
      })}
    </div>
  );
};

export default Projects;
